import React from 'react';
import { Route, Routes } from 'react-router-dom';
import LoginSignup from '../pages/login-signup.jsx';

export default function AllRoutes() {
  return (
    <div>
      <Routes>
        <Route path="/login" element={<LoginSignup />} />
      </Routes>
    </div>
  );
}
